import { Grid, Typography } from "@material-ui/core";
import React from "react";

const CoeInfo = () => {
  return (
    <Grid container>
      <Grid item>
        <Grid container>
          <Grid item>
            <Typography>Cat A</Typography>
            <Typography component="span">CAR UP TO 1600CC & 97KW</Typography>
            <Typography>47,010</Typography>
          </Grid>
        </Grid>
      </Grid>
    </Grid>
  );
};

export default CoeInfo;
